import React from 'react';

class SaveCat extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        list: []
    }
}
    componentDidMount() {
        this.saveCat();
    }

    saveCat = () => {
        fetch('/newestCampground')
        .then(res => res.json())
        .then(list => {
          this.setState({ list: [list] })
        });
    }
  render() {
    let { list } = this.state;
    console.table(list);
    console.log(list.length);
    if (list.length) {
      // list = list.splice(0, 1);
    }
    return(
        <div className="App">
            <h1>List of Items</h1>
                {list.length ? (
                    <div>
                        {list.map(item => {
                            return(
                                <div key={item._id}>
                                    {item.name}
                                    <div className="item-image">
                                      {item.image}
                                    </div>
                                </div>
                            );
                        })}
                    </div>
                ) : (
                    <div>
                        <h2>No List items found</h2>
                    </div>
                )
            }
        </div>
    );
  }
}
export default SaveCat
